import './App.css';
import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Home, Query, Each_news} from "./components";

function App() {
  return (
    <div className="App">
      <Router>
          <Route path="/" component={Home} />
          <Route path="/query" component={Query} />
          <Route path="/each_new" component={Each_news} />
      </Router>
    </div>
  );
}


export default App;
